import React from "react";


export default function List(props){ 
   
    return(
        <div>   
        {
            props.map(list => (
                <div>
                    {list.id}
                    {list.title}
                    {list.content}
                </div>                 
            )
            )}
            <button>Edit</button>
            <button>Delete</button>
        </div>
    );
};
